import React from 'react'
import { NavLink } from 'react-router-dom'

const Menu2 = () => {
  return (
    <>
        <div className='main_div'>
            <NavLink to='/'>About Us</NavLink>
            <NavLink to='/Services'>Services</NavLink>
        </div>
    </>
  )
}

export default Menu2
